INSERT INTO `wp_posts` VALUES (1,1,'2023-11-28 17:38:17','2023-11-28 09:38:17','<!-- wp:paragraph -->\n<p>欢迎使用 WordPress。这是您的第一篇文章。编辑或删除它，然后开始写作吧！</p>\n<!-- /wp:paragraph -->','世界，您好！','','publish','open','open','','hello-world','','','2023-11-28 17:38:17','2023-11-28 09:38:17','',0,'http://yongfeng-desk.bj.intel.com:8399/?p=1',0,'post','',1),(2,1,'2023-11-28 17:38:17','2023-11-28 09:38:17','<!-- wp:paragraph -->\n<p>这是示范页面。页面和博客文章不同，它的位置是固定的，通常会在站点导航栏显示。很多用户都创建一个“关于”页面，向访客介绍自己。例如：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>嗨，大家好！我白天是个邮递员，晚上就是个有抱负的演员。这是我的网站。我住在北京，养了条吉通人性的狗叫小黑，我喜欢艺术和旅行。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>……或这个：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>XYZ Doohickey 公司成立于1971年，自从建立以来，我们一直向社会贡献着优秀 doohickies。我们的公司总部位于天朝魔都，有着超过两千名员工，对魔都政府税收有着巨大贡献。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>而您，作为一位 WordPress 新用户，我们建议您转到<a href=\"http://yongfeng-desk.bj.intel.com:8399/wp-admin/\">您站点的仪表盘</a>，删除本页面，然后创建包含您自己内容的新页面。祝您使用愉快！</p>\n<!-- /wp:paragraph -->','示例页面','','publish','closed','open','','sample-page','','','2023-11-28 17:38:17','2023-11-28 09:38:17','',0,'http://yongfeng-desk.bj.intel.com:8399/?page_id=2',0,'page','',0),(3,1,'2023-11-28 17:38:17','2023-11-28 09:38:17','<!-- wp:heading --><h2>我们是谁</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>我们的站点地址是：http://yongfeng-desk.bj.intel.com:8399。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>评论</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>当访客留下评论时，我们会收集评论表单所显示的数据，和访客的IP地址及浏览器的 User-Agent 字符串来帮助检查垃圾评论。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>由您的电子邮箱地址所生成的匿名化字符串（又称为哈希）可能会被提供给 Gravatar 服务确认您是否有使用该服务。Gravatar 服务的隐私政策在此：https://automattic.com/privacy/。在您的评论获批准后，您的资料图片将在您的评论旁公开展示。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>媒体</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>如果您向此网站上传图片，您应当避免上传那些有嵌入地理位置信息（EXIF GPS）的图片。此网站的访客将可以下载并提取此网站的图片中的位置信息。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>如果您在我们的站点上留下评论，您可以选择用 Cookies 保存您的名字、电子邮箱地址和网站地址。这是通过让您可以不用在评论时再次填写相关内容而向您提供方便。这些 Cookies 会保留一年。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>如果您访问我们的登录页，我们会设置一个临时的 Cookie 来确认您的浏览器是否接受 Cookies。此 Cookie 不包含个人数据，且会在您关闭浏览器时被丢弃。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>当您登录时，我们也会设置多个cookies来保存您的登录信息及屏幕显示选项。登录cookies会保留两天，而屏幕显示选项cookies会保留一年。如果您选择了“记住我”，您的登录会保留两周。如果您注销，登录cookies将被移除。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>如果您编辑或发布文章，我们会在您的浏览器中保存一个额外的 Cookie。这个 Cookie 不包含个人数据而只记录了您刚才编辑的文章的 ID。这个 Cookie 会保留一天。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>来自其他网站的嵌入内容</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>此站点上的文章可能会包含嵌入的内容（如视频、图片、文章等）。来自其他站点的嵌入内容的行为和您直接访问这些其他站点没有区别。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>这些站点可能会收集关于您的数据、使用 Cookies、嵌入额外的第三方跟踪程序及监视您与这些嵌入内容的交互，包括在您有这些站点的账户并登录了这些站点时，跟踪您与嵌入内容的交互。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>我们与谁共享您的信息</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>若您请求重置密码，您的IP地址将包含于密码重置邮件中。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>我们保留多久您的信息</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>如果您留下评论，评论和其元数据将被无限期保存。我们这样做以便能识别并自动批准任何后续评论，而不用将这些后续评论加入待审队列。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>对于本网站的注册用户，我们也会保存用户在个人资料中提供的个人信息。所有用户可以在任何时候查看、编辑或删除他们的个人信息（除了不能变更用户名外）、站点管理员也可以查看及编辑那些信息。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>您对您的信息有什么权利</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>如果您有此站点的账户，或曾经留下评论，您可以请求我们提供我们所拥有的您的个人数据的导出文件，这也包括了所有您提供给我们的数据。您也可以要求我们抹除所有关于您的个人数据。这不包括我们因管理、法规或安全需要而必须保留的数据。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>您的数据将发送到何处</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">推荐的文本： </strong>访客评论可能会被自动垃圾评论监测服务检查。</p><!-- /wp:paragraph -->','隐私政策','','draft','closed','open','','privacy-policy','','','2023-11-28 17:38:17','2023-11-28 09:38:17','',0,'http://yongfeng-desk.bj.intel.com:8399/?page_id=3',0,'page','',0),(4,1,'2023-11-28 17:38:39','0000-00-00 00:00:00','','自动草稿','','auto-draft','open','open','','','','','2023-11-28 17:38:39','0000-00-00 00:00:00','',0,'http://yongfeng-desk.bj.intel.com:8399/?p=4',0,'post','',0),(5,1,'2023-11-28 17:39:25','2023-11-28 09:39:25','','Logo','','inherit','open','closed','','logo','','','2023-11-28 17:39:25','2023-11-28 09:39:25','',0,'http://yongfeng-desk.bj.intel.com:8399/wp-content/uploads/2023/11/logo-1.png',0,'attachment','image/png',0),(6,1,'2023-11-28 17:39:25','2023-11-28 09:39:25','<!-- wp:cover {\"minHeight\":866,\"minHeightUnit\":\"px\",\"customGradient\":\"linear-gradient(35deg,rgb(6,0,151) 0%,rgb(130,4,255) 73%,rgb(193,15,255) 100%)\",\"align\":\"full\"} -->\n<div class=\"wp-block-cover alignfull\" style=\"min-height:866px\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim-100 has-background-dim has-background-gradient\" style=\"background:linear-gradient(35deg,rgb(6,0,151) 0%,rgb(130,4,255) 73%,rgb(193,15,255) 100%)\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:group {\"align\":\"wide\",\"layout\":{\"inherit\":true,\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignwide\"><!-- wp:media-text {\"align\":\"wide\",\"mediaPosition\":\"right\",\"mediaId\":46,\"mediaLink\":\"http://yongfeng-desk.bj.intel.com:8399/?attachment_id=46\",\"mediaType\":\"image\",\"mediaWidth\":43,\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile is-vertically-aligned-center\" style=\"grid-template-columns:auto 43%\"><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"textAlign\":\"left\",\"level\":1,\"textColor\":\"white\"} -->\n<h1 class=\"wp-block-heading has-text-align-left has-white-color has-text-color\">Gen-AI Cloud Solution!</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Pulvinar enim ac tortor nulla facilisi tristique facilisi <br>elementum sollicitudin eget lorem.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"#\">Make a Website</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div><figure class=\"wp-block-media-text__media\"><img src=\"http://yongfeng-desk.bj.intel.com:8399/wp-content/uploads/2023/11/LLM-Architecture.png\" alt=\"\" class=\"wp-image-46 size-full\"/></figure></div>\n<!-- /wp:media-text --></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:group {\"align\":\"wide\",\"layout\":{\"type\":\"constrained\"},\"metadata\":{\"name\":\"introduction\"}} -->\n<div class=\"wp-block-group alignwide\" id=\"introduction\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"wp-block-heading has-text-align-center\">Introduction</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>•Generative AI is the new ”magic” of AI use cases, e.g. LLM(OpenAI, LLaMa, etc.) and picture generating(midjourney, StableDiffusion, etc.).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>•For they do have the potential power to change a lot of things, almost every career and people are paying attention to it. So, it is criticial for out business as well, especially, there are still many technical gaps we need to research.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>•Industry majorities and the common sense are NV GPU+CUDA oriented. But there are many efforts to migrate the workload to CPU only platform, from both community and Intel teams.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>•We Intel has already had the stratagy, products roadmap, dedicated teams focusing on this, as we know, but we cloud native workloads optimization can provide more values based on them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"wide\",\"id\":46,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignwide size-full\"><img src=\"http://yongfeng-desk.bj.intel.com:8399/wp-content/uploads/2023/11/LLM-Architecture.png\" alt=\"\" class=\"wp-image-46\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"144px\",\"bottom\":\"144px\"}}},\"layout\":{\"inherit\":false,\"contentSize\":\"1200px\",\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull\" id=\"benefits\" style=\"padding-top:144px;padding-bottom:144px\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"wp-block-heading has-text-align-center\">Benefits</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"blockGap\":\"80px\",\"margin\":{\"top\":\"60px\"}}}} -->\n<div class=\"wp-block-columns\" style=\"margin-top:60px\"><!-- wp:column {\"style\":{\"spacing\":{\"blockGap\":\"8px\"}}} -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"center\",\"id\":162,\"width\":\"160px\",\"height\":\"auto\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-large is-resized\"><img src=\"http://yongfeng-desk.bj.intel.com:8399/wp-content/themes/astra/inc/assets/images/starter-content/passionate.svg\" alt=\"\" class=\"wp-image-162\" style=\"width:160px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3,\"style\":{\"spacing\":{\"margin\":{\"top\":\"16px\"}}}} -->\n<h3 class=\"wp-block-heading\" style=\"margin-top:16px\">Multiple Models</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>