 almost every career and people are paying attention to it. So, it is criticial for out business as well, especially, there are still many technical gaps we need to research.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>•Industry majorities and the common sense are NV GPU+CUDA oriented. But there are many efforts to migrate the workload to CPU only platform, from both community and Intel teams.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>•We Intel has already had the stratagy, products roadmap, dedicated teams focusing on this, as we know, but we cloud native workloads optimization can provide more values based on them.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"wide\",\"id\":46,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignwide size-full\"><img src=\"http://yongfeng-desk.bj.intel.com:8399/wp-content/uploads/2023/11/LLM-Architecture.png\" alt=\"\" class=\"wp-image-46\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"144px\",\"bottom\":\"144px\"}}},\"layout\":{\"inherit\":false,\"contentSize\":\"1200px\",\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull\" id=\"benefits\" style=\"padding-top:144px;padding-bottom:144px\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"wp-block-heading has-text-align-center\">Benefits</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"blockGap\":\"80px\",\"margin\":{\"top\":\"60px\"}}}} -->\n<div class=\"wp-block-columns\" style=\"margin-top:60px\"><!-- wp:column {\"style\":{\"spacing\":{\"blockGap\":\"8px\"}}} -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"center\",\"id\":162,\"width\":\"160px\",\"height\":\"auto\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-large is-resized\"><img src=\"http://yongfeng-desk.bj.intel.com:8399/wp-